<p>Trong n?m m&ugrave;a g?n nh?t, c&aacute;c ??i Top 4 ghi &iacute;t b&agrave;n nh?t l?n l??t l&agrave; Man Utd (68 b&agrave;n), Chelsea (63), Man Utd (66), Chelsea (58) v&agrave; Tottenham (69). Theo th?ng k&ecirc; n&agrave;y, ??i n&agrave;o mu?n v&agrave;o Top 4 m&ugrave;a t?i ph?i ??m b?o ghi ???c kho?ng 69 b&agrave;n tr? l&ecirc;n.</p>

<p>C&aacute;c ??i Top 4 m&ugrave;a tr??c ??u ?&atilde; c?ng c? h&agrave;ng ti?n ??o v?i nh?ng h?p ??ng ?&aacute;ng ch&uacute; &yacute;, nh? Erling Haaland (Man City), Darwin Nunez (Liverpool), Raheem Sterling (Chelsea) v&agrave; Richarlison (Tottenham). C&ograve;n Man Utd m?i ??a v? ba t&acirc;n binh, ??u ? tuy?n d??i, g?m h?u v? Tyrell Malacia, Lisandro Martinez v&agrave; ti?n v? Christian Eriksen.</p>

