<p>Danh s&aacute;ch ghi b&agrave;n c?a Man UtdNgo?i h?ng Anh 2021-2022RonaldoRonaldoFernandesFernandesGreenwoodGreenwoodFredFredRashfordRashfordSanchoSanchoElangaElangaCavaniCavaniLingardLingardS&aacute;u c?u th? kh&aacute;cS&aacute;u c?u th? kh&aacute;cVnExpress</p>

<p>H&agrave;ng c&ocirc;ng Man Utd m&ugrave;a tr??c g&acirc;y th?t v?ng. Ronaldo ghi g?n m?t ph?n ba s? b&agrave;n c?a ??i, d&ugrave; tr?i qua&nbsp;<a href="https://vnexpress.net/ronaldo-tit-ngoi-6-tran-lien-4426901.html">chu?i t?t ng&ograve;i</a>&nbsp;d&agrave;i nh?t s? nghi?p. Fernandes ghi 10 b&agrave;n, nh?ng th&ocirc;ng s? n&agrave;y gi?m m?nh so v?i 18 b&agrave;n c?a anh ? m&ugrave;a 2020-2021. Edinson Cavani hi?m khi thi ??u, Jadon Sancho ch?a b?t nh?p ???c v?i b&oacute;ng ?&aacute; Anh, c&ograve;n Marcus Rashford v&agrave; Anthony Martial tr?i qua m&ugrave;a gi?i t? nh?t s? nghi?p ? Man Utd.</p>

<p><strong>Nh?ng v?n ?? c?a Man Utd kh&ocirc;ng ch? n?m ? kh? n?ng d?t ?i?m c?a ti?n ??o, m&agrave; ??n t? c&aacute;ch t?o ra c? h?i</strong>. Expected goal (xG) l&agrave; th?ng k&ecirc; cho th?y kh? n?ng th&agrave;nh b&agrave;n t? m?t pha d?t ?i?m, c?ng ph?n n&agrave;o th? hi?n ch?t l??ng c&aacute;c c? h?i m&agrave; ??i b&oacute;ng t?o ra. xG c?a Man Utd m&ugrave;a tr??c l&agrave; 61,5, ??ng th? s&aacute;u, trong khi ??i th? n?m Tottenham ??t 67,2.</p>

<p>Ten Hag ?ang c? g?ng x&acirc;y d?ng l?i l?i ch?i t?n c&ocirc;ng c?a Man Utd. Trong n?m tr?n giao h?u ?&atilde; qua, h? ghi trung b&igrave;nh 3,4 b&agrave;n m?i tr?n. D&ugrave; ch? l&agrave; giao h?u, c&aacute;c b&agrave;n th?ng lu&ocirc;n gi&uacute;p nh?ng ti?n ??o nh? Rashford, Martial hay Sancho th&ecirc;m t? tin. H? ???c k? v?ng d?n d?t h&agrave;ng c&ocirc;ng Man Utd m&ugrave;a t?i, v?i Fernandes ch?i ? v? tr&iacute; h? c&ocirc;ng.</p>

