<p>Trong s&aacute;u m&ugrave;a g?n nh?t,&nbsp;<a href="https://vnexpress.net/chu-de/bruno-fernandes-1253">Fernandes</a>&nbsp;c?n trung b&igrave;nh 2,8 pha d?t ?i?m h??ng c?u m&ocirc;n ?? ghi m?t b&agrave;n, v&agrave; hi?u su?t n&agrave;y c?ng ?n ??nh qua n?m th&aacute;ng. M&ugrave;a 2020-2021, anh th?ng hoa v?i 18 b&agrave;n, t? 51 pha d?t ?i?m v? khung th&agrave;nh. M&ugrave;a tr??c, s? pha d?t ?i?m nh? th? v?i Fernandes ch? c&ograve;n 29, gi?m g?n m?t n?a.</p>

<p><img alt="Martial (gi?a) ghi bàn trong tr?n Man Utd th?ng Liverpool 4-0 ? giao h?u t?i Bangkok hôm 12/7. ?nh: ManUtd" src="https://i1-thethao.vnecdn.net/2022/07/29/martial-2407-1659061288.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=1zEJZ-gZMmc3gnAvwVsCIw" /></p>

