<p>V?i&nbsp;<a href="https://vnexpress.net/chu-de/marcus-rashford-829">Rashford</a>, hi?u su?t c?a anh l&agrave; 3,1 trong n?m m&ugrave;a g?n ?&acirc;y. C?ng nh? Fernandes, Rashford d?t ?i?m h??ng c?u m&ocirc;n 37 l?n m&ugrave;a 2020-2021, nh?ng th&ocirc;ng s? ?&oacute; gi?m xu?ng c&ograve;n 12 l?n m&ugrave;a 2021-2022, th?m ch&iacute; kh&ocirc;ng b?ng m?t ph?n ba c?a m&ugrave;a tr??c ?&oacute;.</p>

